@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:InvalidPassword
    rdf:type owl:Class ;
    rdfs:subClassOf atm:Password .

atm:BadPasswordMessage
    rdf:type owl:Class ;
    rdfs:subClassOf atm:Message .

atm:BankComputer
    rdf:type owl:Class .

atm:sendsMessage
    rdf:type owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:Message .

atm:hasPassword
    rdf:type owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:Password .

atm:BankComputer
    rdfs:subClassOf [
        rdf:type owl:Restriction ;
        owl:onProperty atm:hasPassword ;
        owl:someValuesFrom atm:InvalidPassword
    ] .

atm:BankComputer
    rdfs:subClassOf [
        rdf:type owl:Restriction ;
        owl:onProperty atm:sendsMessage ;
        owl:someValuesFrom atm:BadPasswordMessage
    ] .
